watchEvents.apiJsonc:
{
    "url": "{{if(parameters.calendar, if(parameters.calendarGroup, '/me/calendargroups/'+ parameters.calendarGroup +'/calendars/'+ parameters.calendar +'/events', '/me/calendars/'+ parameters.calendar +'/events'), '/me/events')}}",
    "method": "GET",
    "qs": {
        "$top": 500,
        "$orderby": "{{switch(parameters.select, 'create', 'createdDateTime desc', 'update', 'lastModifiedDateTime desc')}}",
        "$filter": "{{filter(parameters.filter)}}"
        //"$search": "{{parameters.search}}" - doesn't support this event api
    },
    "response": {
        "iterate": "{{body.value}}",
        "trigger": {
            "id": "{{item.id}}",
            "date": "{{switch(parameters.select, 'create', item.createdDateTime, 'update', item.lastModifiedDateTime)}}",
            "type": "date",
            "order": "desc"
        },
        "output": "{{generalResponse(item)}}",
        "limit": "{{parameters.limit}}"
    },
    "pagination": {
        "url": "{{body.`@odata.nextLink`}}",
        "condition": "{{ifempty(body.`@odata.nextLink`, false)}}"
    }
}

